import React from 'react';
import './ProcessUnitPage.css';

const ReactorPage = () => (
  <div className="process-unit-page">
    <h1>Chemical Reactor</h1>
    <img src="https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=800&q=80" alt="Chemical Reactor" className="unit-image" />
    <p>
      Reactors are vessels designed to contain chemical reactions. They are essential in chemical engineering for converting raw materials into valuable products.
    </p>
  </div>
);

export default ReactorPage;
